const PlanTripPage: React.FC = () => {
  return (
    <div style={{ padding: "2rem", textAlign: "center" }}>
      <h1>Plan Trip</h1>
      <p>This is a placeholder for the Plan Trip Page.</p>
    </div>
  );
};

export default PlanTripPage;
